tables.table_schema:
CREATE TABLE SolarPanelData (
  id INT PRIMARY KEY,
  efficiency DECIMAL,
  placement TEXT,
  maintenance_schedule TEXT
);

CREATE TABLE solar_panels (
    id INT PRIMARY KEY,
    efficiency DECIMAL,
    placement VARCHAR(255),
    maintenance_schedule VARCHAR(255)
);

CREATE TABLE maintenance_logs (
    log_id INT PRIMARY KEY,
    panel_id INT,
    maintenance_date DATE,
    maintenance_description TEXT
);

CREATE TABLE efficiency (
  panel_id INT PRIMARY KEY,
  efficiency_rate DECIMAL
);

CREATE TABLE placement (
  panel_id INT PRIMARY KEY,
  location VARCHAR(255),
  orientation VARCHAR(255)
);

CREATE TABLE maintenance_schedule (
  panel_id INT PRIMARY KEY,
  last_maintenance_date DATE,
  next_maintenance_date DATE
);

CREATE TABLE SolarPanels (
  id SERIAL PRIMARY KEY,
  efficiency DECIMAL,
  placement TEXT,
  maintenance_schedule TEXT
);

CREATE TABLE EfficiencyData (
  id SERIAL PRIMARY KEY,
  panel_id INT,
  efficiency DECIMAL,
  reading_timestamp TIMESTAMP
);

CREATE TABLE PlacementData (
  id SERIAL PRIMARY KEY,
  panel_id INT,
  latitude DECIMAL,
  longitude DECIMAL
);

CREATE TABLE MaintenanceSchedule (
  id SERIAL PRIMARY KEY,
  panel_id INT,
  schedule TEXT,
  next_maintenance_date DATE
);

CREATE TABLE Efficiency (
  id SERIAL PRIMARY KEY,
  panel_id INT NOT NULL,
  efficiency_value FLOAT NOT NULL
);

CREATE TABLE Placement (
  id SERIAL PRIMARY KEY,
  panel_id INT NOT NULL,
  location VARCHAR(255) NOT NULL
);

CREATE TABLE Maintenance (
  id SERIAL PRIMARY KEY,
  panel_id INT NOT NULL,
  maintenance_date DATE NOT NULL,
  maintenance_type VARCHAR(255) NOT NULL
);

CREATE TABLE SolarPanel (
  id SERIAL PRIMARY KEY,
  panel_name VARCHAR(255) NOT NULL,
  installation_date DATE NOT NULL,
  manufacturer VARCHAR(255) NOT NULL
);

CREATE TABLE PanelStatus (
  id SERIAL PRIMARY KEY,
  panel_id INT NOT NULL,
  status VARCHAR(255) NOT NULL
);
